import React from 'react';
import Menu from './Menu';
import Pages from './Pages';
import Footer from './Footer';
import HeroSlider from './HeroSlider';
function App(){
    return(
        <>
            <div className='Navbar'><Menu /></div>
                <Pages />
                <HeroSlide />
            <Footer />
            
        </>
    )
}

export default App;
